import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hello Leda I LOVE U!</h1>



      </div>

    );
    const myelement = (
      <table>
        <tr>
          <th>Name</th>
        </tr>
        <tr>
          <td>John</td>
        </tr>
        <tr>
          <td>Elsa</td>
        </tr>
      </table>
);
  }
}

export default App;
